import React, { Component } from "react";
import axios from "axios";



export default class WorkoutSelector extends Component {
    constructor() {
        super();
        this.state = {
            weather: "Not yet"
        };
    }

    componentDidMount = () => {
        axios.get("/getworkouts").then(props => {
            console.log(props);
        })
    };
    render() {
        return (
            <div className="col-md-4 offset-md-1">
                <h1>Selection <i class="fa fa-plus"></i></h1>
                <ul id="selectionList">
                    <li><span className="plus"><i class="fa fa-plus"></i></span>{props.data.workouts[0].title}</li>
                    <li><span className="plus"><i class="fa fa-plus"></i></span>Shoulder Press and Squat Press</li>
                    <li><span className="plus"><i class="fa fa-plus"></i></span>Curls and Tricep Extensions</li>
                    <li><span className="plus"><i class="fa fa-plus"></i></span>b</li>
                    <li><span className="plus"><i class="fa fa-plus"></i></span>a</li>
                    <li><span className="plus"><i class="fa fa-plus"></i></span>a</li>
                    <li><span className="plus"><i class="fa fa-plus"></i></span>a</li>
                    <li><span className="plus"><i class="fa fa-plus"></i></span>a</li>
                    <li><span className="plus"><i class="fa fa-plus"></i></span>a</li>
                </ul>
            </div>
        )
    }
};
